Key Language School проводит новые акции!
Мы рады представить нашим Клиентам новые акции и предложения:
• Приводите друзей и получите единоразовую скидку 100грн за каждого;
• Присоединяйтесь к нам в Vkontakte, Facebook, Linkedin и получите скидку 2%;
• На семейное обучение (минимум 3 человека) скидка 10% одному;
• Для наших студентов скидка 10% на продолжение обучения;
• Для владельцев карточки ISIC скидка на обучение 10% на занятия в группе и 5% на индивидуальные;
• При оплате полного курса скидка 10%.
Воспользуйтесь уникальными возможностями, которые предлагает Key Language School, и присоединяйтесь к нам уже сейчас!
